const canvas = document.getElementById('canvas1');
// Making instance of canvas 2d api object
const ctx = canvas.getContext('2d');
// Must be same as in css for correct scaling
canvas.width = 800;
canvas.height = 450;
// Image = special JS class constructor
const image1 = new Image();
// Assigning object src property
// image1.src = 'car.jpg'
image1.src = 'data:image/jpeg;base64,';
// Adding load event listener
image1.addEventListener('load', function(){
    // Drawing image top left (0,0) [w,h are declared up]
    ctx.drawImage(image1, 0, 0);
    // We want to know color of each pixel
    const scannedImage = ctx.getImageData(0 , 0,
        canvas.width, canvas.height);
    // Up we passed start and end cordinates
    console.log(scannedImage);
    // Scanner goes from left to right, row by row,
    // from top to bottom and returns ImageData obj
    const scannedData = scannedImage.data;
    // Saving pixel array data
    for (let i = 0; i < scannedData.length; i+= 4){
        // Sum of RGB values
        const total = scannedData[i] 
        + scannedData[i+1]
        + scannedData[i+2];
        // Average RGB value (to make pic grey)
        const averageColorValue = total/3;
        scannedData[i] = averageColorValue; //filter
        scannedData[i+1] = averageColorValue; //can
        scannedData[i+2] = averageColorValue; //do
    }
    // Reassigning
    scannedImage.data = scannedData;
    // This will paint data to canvas
    ctx.putImageData(scannedImage, 0, 0)
})
